import { BrowserRouter, NavLink, Route, Routes } from 'react-router-dom';
import './App.css';

const RoomSettings = () => {
  return (
    <div>
      hello
    </div>
  );
}

const App = () => {
  return (
    <BrowserRouter>
      <div>
        <header>
        </header>
        <body>
          <NavLink to='/roomSettings'>room</NavLink>
          <Routes>
            <Route path='/roomsettings/*' element={<RoomSettings></RoomSettings>}></Route>
            {/* <div className='roomSettingsButton'>
              <button>Перейти в настройки переговорной комнаты</button>
            </div> */}
          </Routes>
        </body>
      </div>
    </BrowserRouter>
  );
}

export default App;
